Product Description
Herbal medicinal products are increasing in popularity in the developed world although there are many concerns about their quality, safety and efficacy. &quot;Herbal Medicines&quot; provides a comprehensive single source of scientifically rigorous, impartial information on over 150 of the most commonly used herbal medicinal products. This third edition has been extensively revised and updated. It aims to answer the questions raised for the healthcare professional by providing scientifically rigorous, impartial information on medical herbs. 
